import ExpenseItem from "./ExpenseItem";
const ExpensesList = ({ items }) => {
  let expensesContent = <p>No expenses found.</p>;

  if (items.length > 0) {
    expensesContent = items.map((item, index) => {
      return (
        <ExpenseItem
          key={index}
          title={item.title}
          amount={item.amount}
          date={item.date}
        />
      );
    });
  }
  return <ul className="expenses-list"></ul>;
};

export default ExpensesList;
